import React, { useState } from 'react';
import './index.css';



function App(){
    const vstate = useState();

    const [count , setcount] = useState(50);

    
    function NumIncrement(){
      setcount(count + 1);
    }
    return (
        <React.Fragment>        
        <h1 >{count}</h1>
        <button onClick={NumIncrement}>Click Me</button>
      </React.Fragment>
    )
}

export default App;
